import React from 'react';
import { Navigate, Route } from 'react-router-dom';

const ProtectedRoute = ({ children, loggedIn }) => {
  return (
    <Route>
      {
        () => loggedIn ? children : <Navigate to='/sign-in' />
      }
    </Route>
  )}

export default ProtectedRoute;
